INSERT INTO `wz_oxdata` VALUES (1,1,'生活在丛林深处的怪猫是可以进行远距离攻击和近身攻击的强力的怪物。','怪猫只会进行近身攻击。','x'),(1,2,'火独眼兽、风独眼兽、冰独眼兽是长得差不多的怪物，其中只有火独眼兽有2只眼睛。','所有的都是1只眼睛。','x'),(1,3,'骑着扫帚飞来飞去的巫婆用强力的魔法光线攻击远距离的玩家。','巫婆是近距离攻击的怪物。','x'),(1,4,'骑着扫帚飞来飞去的巫婆惧怕圣属性魔法。','巫婆惧怕圣属性魔法。','x'),(1,5,'矿山僵尸和僵尸之中，僵尸的等级更高。','两者的等级都是57级。','x'),(1,6,'会飞的怪物蝙蝠每飞一段时间，就会吊在天花板上休息。','不休息一直飞行。','x'),(1,7,'黄金海岸可以看到的长得像梭子蟹的怪物红螃蟹偶尔会跳跃攻击。','虽然长得像梭子蟹，但是也会跳跃攻击。','o'),(1,8,'蓝独角狮是会进行冰冻攻击的怪物。','是进行冰属性攻击，而且弱点是火属性的怪物。','o'),(1,9,'长得像可爱的海龟一样的怪物乌龟会进行强力的远距离攻击。','乌龟是会远距离攻击的怪物。','o'),(1,100,'赤龙是龙系怪物中唯一能进行远距离攻击的怪物。','赤龙和冰龙都会进行远距离攻击。','x'),(1,101,'主要生活在沼泽地带的黑鳄鱼是比土龙等级更高的怪物。','黑鳄鱼是(52级)，土龙是(45级)。','o'),(1,102,'在勇士部落的周边可以见到土龙，他是青龙的进化种，远距离攻击是其特征。','只会近距离攻击，不会远距离攻击。','x'),(1,103,'冰峰雪域登场的所有怪物，都有惧怕火属性魔法的特点。','黑雪人、黑企鹅王惧怕圣属性魔法。','x'),(1,104,'小海狮在受到攻击时，会和头顶上的小海豹分离，一起进行攻击。','小海狮无法分离。','x'),(1,105,'等级为100的蝠魔不会因毒魔法而中毒。','具有使毒魔法无效，惧怕圣魔法的特点。','o'),(1,106,'坐着扫帚飞来飞去的巫婆是不死系怪物。','巫婆虽然惧怕圣属性魔法，但并不是不死系怪物。','x'),(1,107,'龙虾怪物大龙虾在吃了黄金炸虾之后会更容易捕捉。','和黄金炸虾没有关系。','x'),(1,108,'斧木妖是由于伐木工没有拔出斧子，因为怨恨而诞生的怪物。','传说是由于伐木工没有拔掉斧子而发出怨恨，因此而重生。','o'),(1,109,'北半球的水流漩涡是逆时针旋转的.','水流旋转与地球自转有关，观察一下就知道，我们身处的北半球漩涡是逆时针的！','o'),(1,110,'狼人在受到攻击时，会召唤分身进行攻击。','狼人没有分身。','x'),(1,111,'童话村里登场的鬼怪中，绿色鬼怪可以用荞麦蒟蒻召唤。','绿色鬼怪-荞麦蒟蒻','o'),(1,112,'童话村里登场的鬼怪中，蓝色鬼怪可以用猪肉串召唤。','蓝色鬼怪-谷茶','x'),(1,113,'童话村里登场的鬼怪中，黄色鬼怪可以用谷茶召唤。','黄色鬼怪-猪肉串','x'),(1,114,'冒险岛中最弱的怪物是“蘑菇仔”。','不是蘑菇仔，蜗牛才是最弱的怪物。','x'),(1,115,'动物森林中的狐狸和狸猫的额头上都贴着树叶。','两种怪物的额头上都贴着树叶。','o'),(1,116,'捕捉中国上海郊外的大头鸭可以获得鸭脚。','可以获得鸭蛋，而不是鸭脚。','x'),(1,117,'捕捉中国上海郊外的绵羊可以获得羊毛。','捕捉绵羊可以获得羊毛。','o'),(1,118,'中国上海郊外的斗鸡全都是公鸡。','全都是有大红冠子的公鸡。','o'),(1,119,'捕捉中国徐州岔道的山羊，可以获得山羊胡子。','捕捉山羊，可以获得白色的角。','x'),(1,120,'冒险岛的诞生日是7月23日','对于冒险岛的重要庆典日我们又怎么能记错呢？7月23日是我们共同的节日！','o'),(2,1,'勾心斗角原本是指中国古代建筑呈现出的艺术形态','最初的勾心斗角是艺术的美，现在有点不和谐啊，让我们为了追求美好而努力吧！','o'),(2,2,'从商店购买100%卷轴的时候，双手武器卷轴要比单手武器卷轴贵。','双手武器卷轴和单手武器的价格都一样。','x'),(2,3,'魔法密林武器商店出售长杖卷轴和短杖卷轴。','目前的武器商店并没有直接出售卷轴。','x'),(2,100,'要制作弓箭手的手套“绿狩猎手套”，红狩猎手套必须要有的材料。','必须要有的材料是蓝狩猎手套。','x'),(2,101,'五花八门的由来是中国古代有名的花鸟集市闻名遐迩开有八个门的大排场','其实这完全是胡说的，五花和八门原来是中国古代用兵的2种阵法。','x'),(2,102,'道具黄金炸虾可以在水下世界的杂货商人安纳斯那里买到。','在其他地方没有销售。','o'),(2,103,'制作魔法师手套红守护手套时，需要用到动物的皮革共60张。','需要动物皮革60张，由魔法密林的易德制造。','o'),(2,104,'青铜弓矢和钢铁弓矢可以通过弓箭手的村庄(射手村)的比休斯制作。','比休斯只能制作青铜弓矢。','x'),(2,105,'制作提炼石的时候，价钱最贵的提炼石是星石。','黑暗水晶的价格是50000金币，是最贵宝石。','x'),(2,106,'要在未装备的道具上使用卷轴，必须学会“匠人之魂”技能。','必须学习匠人之魂技能，才能在未装备的道具上使用卷轴。','o'),(2,107,'装备窗口的每个空格可以叠放100张怪物卡片。','可以叠放1,000张怪物卡片。','x'),(2,108,'攻击速度为快速的木精灵枪可以在武器销售员百鸟警官那里买到。','武器销售员百鸟警官那里可以买到木精灵枪。','o'),(3,1,'暖炉可以在寒冷的天气里使用，使房间变得温暖。','暖炉也可以用来烤红薯或者加热其他食物。','o'),(3,2,'植物的茎是输送根部吸收的水的通道。','植物根部吸收的水分会沿着植物的茎移动。','o'),(3,3,'放出光线的物体称为“光源”。','火、阳光、日光灯等都是光源。','o'),(3,4,'数学中的三角函数，余弦的表示是SIN','欧欧欧，NO，NO，NO。余弦其实是COS啊！不过并不是动漫里的COSPLAY哦~','x'),(3,5,'物体受到光线照射产生的明亮和黑暗成为“明暗”。','物体的明暗可以让人感受到立体感和量感。','o'),(3,6,'发现了X射线的科学家名叫伦琴','是的，X射线也叫伦琴射线，也是伦琴偶然发现的，但绝不是X-MAN发现的哦！','o'),(3,7,'绿水灵的珠子要比蓝水灵的大','这个用你自己的眼睛确认一下印象就深刻了，蓝水灵的珠子比绿水灵的珠子大不少哦','x'),(3,8,'夏季由于空调而引起的疾病称为空调病。','室内外的温度差最好能在5°C左右。','o'),(3,9,'有一个叫做[什么飞蛋打]的俗语。这里的“什么”是鸡。','用来描述不相关的两件事同时发生的情况。','o'),(3,10,'梅雨季节里水果的口味会变差。','梅雨季节里经常下雨，水果吸收了大量水分之后糖度会下降。','o'),(3,11,'汗的作用是把体内的废弃物排出体外，以及调节体温和保护皮肤。','最好能让身体自然地流汗。','o'),(3,12,'夏季屋内屋外的温差最好能在5°C左右。','温差大于5°C时，容易得空调病。','o'),(3,13,'夏季吃太多凉的东西可以导致消化能力下降。','吃凉的食物容易使人体内部热量不足。','o'),(3,14,'紧张的时候手心会出汗的原因是血压上升导致体温升高。','身体在热的时候会试图通过出汗来降低体温。','o'),(3,15,'电车票和电话卡用磁铁摩擦的话，上面记录的信息就会被清除。','利用磁铁的性质制作而成的物品靠近磁铁的话，上面的信息可以被清除。','o'),(3,16,'西瓜是水分很多的水果。','西瓜中含有的水分占90%以上。','o'),(3,17,'夏天的夜晚要比冬天长。','夏天的夜晚要比冬天短。','x'),(3,18,'绿水灵的珠子要比蓝水灵的珍稀','绿水灵的珠子比蓝水灵珠子珍稀许多，不少玩家都在为了绿水灵珠子四处奔波哦','o'),(3,19,'要获得休彼德曼的项链必须参加怪物嘉年华赢取一定数量印有休彼德曼头像的纪念币','特别形状的纪念币上印刻的是枫叶呀！','x'),(3,20,'衣食住是指人们生活所必需的衣服、食物和娱乐。','衣食住是指衣服、食物和房子。','x'),(3,21,'空气加热之后，空气的体积会缩小。','空气加热之后，体积会增大。其体积随着温度的不同而不同。','x'),(3,22,'颜色的三要素中“明度”是指颜色清澈和浑浊的程度。','颜色的明亮和黑暗的程度称为“明度”，清澈和浑浊的程度称为彩度。','x'),(3,23,'吸血的蚊子是雄蚊子。','吸血的蚊子是雌蚊子，雄蚊子一般吸食植物的茎液(树叶)。','x'),(3,100,'最初通过完成任务会送你休闲椅子的男孩叫皮罗','人家不叫皮罗，叫皮奥，你们有没有获得皮奥做的休闲椅子呢？','x'),(3,101,'抽奖获得“月亮弯”椅子以后，可以向其他玩家卖出很高的价钱哦','“月亮弯”很漂亮也很稀有，但是它不可以交易，不过能获得月亮弯是很幸运的哦~','x'),(3,102,'C大调时，在五线谱的下加一间和第二线分别唱MI、SO','唱对了么？仔细回忆一下，第二线是唱SO，不过下加一间是唱RE哦~','x'),(3,103,'上下排列的红绿灯的排列从上到下一次为红、黄、绿','这是生活中的小常识哦，大家可以验证一下，就是红、黄、绿','o'),(3,104,'龙骑士的潜龙出渊绝招可以攻击全屏的怪物','拜托，潜龙出渊是海盗的技能，龙骑士有一招叫龙咆哮！','x'),(3,105,'GM在和玩家组队以后可以施放强力辅助技能提升玩家各方面能力','GM可以施放超强辅助技能来祝福玩家，不过作为公平的管理员，不可以与玩家组队','x'),(3,106,'诺贝尔奖分物理学、化学、生物和医学、文学、和平、经济学6个部门的奖项。','诺贝尔奖于1901年设立，当时包括7个领域的奖项。','x'),(3,107,'神射手可以在神木村接到任务通过努力抚养一只冰凤凰','神射手可以抚养的是火凤凰，箭神才可以抚养冰凤凰，但是2种神鸟都很强大哦','x'),(3,108,'冒险岛的船长有机会获得自己的战船，还可以请海鸥帮忙战斗','船长真的可以驾驶拉风稳重的战船，还能呼唤章鱼和海鸥助战！','o'),(3,109,'在太阳系中，位于土星和海王星中间的是天王星。','太阳-水星-金星-地球-火星-木星-土星-天王星-海王星-冥王星','o'),(3,110,'夏天下雨之后会变凉快的原因是因为固体→液体→气体(吸热反应)。','是因为固体→液体→气体：吸热反应。','o'),(3,111,'冬天睡觉叫冬眠，夏天睡觉叫做夏眠。','夏眠的动物有玉筋鱼、海参、瓢虫等。','o'),(3,112,'台风的名字是由各个国家各提交10个的总共140个名字，分成5个组，每组28个。','台风的名字是由各国提交并命名的。','o'),(3,113,'蚊子吸食人类或动物的血，是为了获得动物性蛋白质。','马上面临产卵期的雌蚊子吸血时为了获得动物性蛋白质。','o'),(3,114,'中暑的时候，最好能喝绿豆汤。','中暑的时候喝点绿豆汤，能降暑气。','o'),(3,115,'中国农历九月初九是“重阳节”，我们有“登高”的传统习俗。','这是中国传统节日和习俗，重阳还有一个主题是孝敬长辈哦！','o'),(3,116,'冰雷魔导师和火毒魔导师最后还可以修成逆属性招数','确实是这样，魔导师借助科学与魔法的双重力量可以习得逆属性的招数，是不是很酷很强大？','o'),(3,117,'由于山上的气压较低，因此水的沸点要比平地上高很多。','山顶上水的沸点较低，因此煮饭很容易夹生。','x'),(3,118,'[母野鸡]是指长大了的母鸡。','母野鸡是指雌性的野鸡。雄性野鸡被叫做公野鸡。','x'),(3,119,'镜子能照出人影是因为光的反射现象','镜子投影是光的反射造成的，同时也与反射物的材料有关，所以镜子可以照得更加清晰','o'),(3,120,'近视眼镜的镜片是凸透镜','虽然镜片一面看上去是凸出的，但是近视镜片是凹透镜做的','x'),(3,121,'商城里卖的气球都是勇士部落酋长用嘴吹起来的','商城的气球都会飘起来，而人吹的气球是飘不起来的，所以这是胡说的','x'),(3,122,'新一代机器宠叫罗伯，是地球防御总部的金博士发明制造的','金博士很厉害哦，设计制作了许多高科技机器人，罗伯也是金博士送给大家的礼物','o'),(3,123,'煮粥的时候在锅里加几滴油可以有效防止粥扑出来','这是个生活小窍门哦，大家自己可以回家试一试','o'),(3,124,'生活在海里的虾和其他鱼贝类不同，大脑长在尾巴上。','虾的大脑长在脑袋里。','x'),(3,125,'希腊神话中的众神之神是叫雅典娜么？','雅典娜是智慧女神，众神之神是她的爸爸，叫宙斯','x'),(3,126,'冒险岛的英文名称是叫APPLE STORY么？','MAPLE STORY~不是APPLE，大家娱乐的时候也可以学学英文哦~','x'),(3,127,'中国传统文化中的天干地支是12天干12地支么？','这个题目也挺有趣的哦，中国有10个天干12地支，而12地支又分别对应了12生肖','x'),(3,128,'夏天开放的代表性的花有向日葵、木莲、喇叭花等等。','木莲被称作春天的化身。','x'),(3,129,'河马的汗是红色的。','因为河马的汗腺会分泌出红色的粘稠的分泌物。','o'),(3,130,'汗水比泪水更咸。','泪水更咸。汗水中99%是水，而泪水中有98%的成分是水。','x'),(3,131,'被蚊子咬了之后会感到痒，是因为&lt;念珠菌>的缘故。','被蚊子咬了之后会感到痒，是因为&lt;组织胺>的缘故。','x'),(3,132,'围棋的白棋和黑棋是在棋盘上争斗。围棋棋盘的交点一共有361个。','19 x 19 = 361。','o'),(3,133,'立夏是太阳在黄经45°的时候。','太阳到达黄经45°的时候，夏天就来到了。这一节气被称为立夏。','o'),(3,134,'蒸发是一种化学现象','蒸发是一个物理变化，物质的化学性质没有改变','x'),(3,135,'与夏季相比，高血压多发生在冬天。','因为寒冷的天气会使血管收缩，从而使血压升高。','o'),(3,136,'直接由气态转变为固态的物理现象叫凝固','直接由气态转变为固态的物理现象叫凝华，不叫凝固，我们要严谨！','x'),(3,137,'英国将在鸦片战争后占领的香港归还给中国的时间是1997年。','1997年7月1日，香港结束了155年的殖民统治，最终回归中国。','o'),(3,138,'冰激凌最初是在中国制作出来的。','公元5世纪的时候，在中国第一次制作出了冰果，作为皇帝的点心。','o'),(3,139,'印刷术发明以后，最早印刷的报纸是德国的《报道式新闻报》。','德国报纸《报道式新闻报》是最早的印刷报纸。','o'),(3,140,'世界著名的音乐家贝多芬，他是德国人','贝多芬是德国作曲家，对世界音乐的发展有着举足轻重的作用，被尊称为“乐圣”。','o'),(3,141,'世界级巨匠梵高和保罗·高更都是后印象派画家。','梵高和保罗·高更都是具有代表性的后印象派画家。','o'),(3,142,'在德国人魏格纳提出的大陆漂移说中，称古代统一的巨大陆地的话是“泛大陆”。','泛大陆是指连成一块的巨大的大陆。','o'),(3,143,'从1依次加到100，结果是5050','确实结果是5050哦，这种算术题的窍门大家是不是掌握呢','o'),(3,144,'游泳以前不能吃得太饱，所以可以空腹去游','为了大家的身体健康成长，专家提醒，空腹和饱腹都不适宜游泳','x'),(3,145,'动画的词根是动物(Anima/拉丁语)。','多张画面连续显示，让人感觉画面是在动。','o'),(3,146,'中国的报警电话是110，火警是119，急救是120','这些号码都是正确匹配的，要牢记哦，紧急的情况下可能就会起到关键作用','o'),(3,147,'被成为“乐器之王”的是小提琴','虽然小提琴音色很美妙知名度也很高，不过“乐器之王”现在还是钢琴啊','x'),(3,148,'化学元素周期表之父是门捷列夫','这题比较偏，有专业知识的玩家占点便宜，据说门捷列夫做元素周期表时还有些奇幻色彩的小故事呢！','o'),(3,149,'雌性蝉因为有特殊的发声器，所以可以发出很高的声音。','已知是雄性蝉长有特殊的发声器，所以可以发出很高的声音。','x'),(3,150,'猫的胡子可以帮助它测量老鼠洞大小判断自己能否进入','猫胡子就像它的一把尺，所以不能随便修剪哦','o'),(3,151,'夏季里的节气有“立夏、小满、白露、夏至、小暑、大暑”。','“白露”是秋天里的节气。','x'),(3,152,'发明了地动仪的中国古代科学家叫张恒','科学要严谨，中国的骄傲也要牢记，发明地动仪的人，叫“张衡”，不是“张恒”哦','x'),(3,153,'中国书法中的“颜体”是指书法家颜真卿的书体','就是这样，“颜体”是颜真卿的书体，大家还可以去了解一些其他书体','o'),(3,154,'冒险岛中要去上海豫园要去找导游小姐','错错错，想去上海豫园要去勇士部落寻找飞行员伯伯让他带你过去滴','x'),(3,155,'冒险岛商城中很多服饰都是限时推出的，过了时段想买也买不到','因为限时限量，每一份拥有都可能成为珍藏品哦，如果有你喜欢的，要抓紧把握机会啊！','o'),(3,156,'《蒙娜丽莎》、《最后的晚餐》、《向日葵》都是伟大艺术大师达芬奇的作品','虽然作品和作者都很有名，不过也不能张冠李戴哦，《向日葵》是另一位画家梵高的作品','x'),(3,157,'世界7大奇迹之一的胡夫金字塔的侧面和地面全都是正三角形的。','侧面是三角形，地面是四角形。','x'),(3,158,'恐龙的名字里很多都用到词根sauros，是拉丁语“恐怖”、“可怕”的意思。','sauros是拉丁语蜥蜴的意思。','x'),(3,159,'废弃都市的飞侠一转教官叫达可鲁','好好了解一下游戏就知道啦，达可鲁，这么酷的名字，配飞侠一转教官就对啦！','o'),(3,160,'每次登录冒险岛过程中都可以看到蘑菇仔','仔细回想一下，在点击登录冒险岛时，可以看到的是可爱的花蘑菇哦。','x'),(3,161,'法国的有名的小说《小王子》的作者是圣·德克旭贝里。','原名：Antoine Marie Roger De Saint Exupery','o'),(3,162,'1993年在法国出现了印着小王子的纸币。','正面印着圣·德克旭贝里的肖像，反面印着“小王子”的可爱的形象。','o'),(3,163,'研发出DOS、Windows等的微软(Microsoft)的创立者是斯蒂芬·霍金博士。','微软的创立者是比尔·盖兹。','x'),(3,164,'中国古代著名的教育家孔子，在家里排行老二。','孔子原名孔丘，字仲尼，在家确实排行老二。古代取字时的“伯仲叔季”是年龄排行的一个标志。','o'),(3,165,'三国演义提及的三国是指“魏蜀吴”','这个答案算不算“中国人都知道”呢？曹操的“魏”、刘备的“蜀”、孙权的“吴”','o'),(3,166,'耳熟能详的诗句“窗前明月光，疑是地上霜”的诗的名字叫《夜月思》','这个题目比较冷吧，大家熟悉诗，名字可能不清楚呢，这首诗叫《静夜思》','x'),(3,167,'72乘以11等于782','哦哦，大家是用计算器计算的还是有小敲门呢？不管怎么样，这个题的答案应该是792','x'),(3,168,'马是可以站着睡觉的动物之一，长颈鹿也和马一样站着睡觉。','长颈鹿和马都站着睡觉。','o'),(3,169,'鸡蛋和牛奶最好不要一起吃','这是健康饮食小常识，大家早餐可能会一起吃这些东西，但实际上这2个东西不宜一起吃，会使营养下降哦','o'),(3,170,'太阳系中最大的行星是金星。','最大的行星是木星。','x'),(3,171,'变色龙遮住眼睛的话就无法改变身体的颜色。','变色龙是用眼睛观察周围环境的颜色，从而改变身体的颜色。','x'),(3,172,'鲨鱼的牙齿掉了或者碎了之后还能再长出来。','鲨鱼可以持续生长。','o'),(3,173,'猫既没有眉毛，也没有眼睫毛。','既有眉毛、也有眼睫毛。','x'),(3,174,'人的一生中，掌纹和指纹都不会变化。','指纹不会变化。','o'),(3,175,'63大厦的高度比南山塔的建筑的高度更高。','63大厦的高度是249m，南山塔是236.7m。','x'),(3,176,'蜗牛没有牙齿。','蜗牛有牙齿。','x'),(3,177,'金鱼可以倒退着游。','鳍的构造决定了不能倒退着游。','x'),(3,178,'公鸡可以下蛋。','由于荷尔蒙异常而导致中性化的公鸡，有可能可以产下未成熟卵。','o'),(3,179,'蜉蝣有嘴巴。','由于生命很短，消化器官退化，所以没有嘴巴。','x'),(3,180,'有衡量辣味的单位。','辣椒的辣度的国际标准是SHU(Scoville Heat Unit)。','o'),(3,181,'感到恐惧的时候体温会下降。','感到恐怖的时候会分泌交感神经素，从而使体温上升。','x'),(3,182,'公用电话也可以重拨。','按重拨后，按#键就能重拨号码。','o'),(3,183,'长颈鹿和人的颈骨数量相同。','他们的颈骨数量都是7块。','o'),(4,1,'攻击神水可以在3分钟内提高物理攻击力10.','可以在3分钟时间内提高物理攻击力5.','x'),(4,2,'在魔法密林杂货店购买蓝色药水，每个可以比其他地方节省8金币。','在魔法密林杂货店可以买到便宜的蓝色药水','o'),(4,3,'喝了速度药水之后，可以在5分钟内提高移动速度。','可以在3分钟内提高移动速度。','x'),(4,4,'喝了魔力神水之后，魔力在5分钟内提高10。','魔力在3分钟内提高5.','x'),(4,5,'喝了古木树液之后，魔力在5分钟内提高10。','魔力在5分钟内提高10。','o'),(4,6,'吃了龙肉之后，可以在3分钟内提高物理防御力10。','可以在3分钟内提高物理防御力10。','o'),(4,7,'喝了龙血之后，可以在5分钟内提高物理攻击力10。','可以在5分钟内提高物理攻击力8。','x'),(4,8,'超级药水只要喝1个，就可以使HP和MP100%恢复。','超级药水可以使HP和MP全部恢复。','o'),(4,9,'在玩具城出售的药丸比药水能携带更多。','药水每格只能放100个，而体积较小的药丸每格可以放150个。','o'),(4,10,'冒险岛中有可以治疗一切异常状态的药。','有可以治疗所有异常状态的万能疗伤药。','o'),(4,100,'喝了命中神水之后，可以在5分钟内提高命中率5。','可以在5分钟内提高命中率5。','o'),(4,101,'喝了敏捷药水可以在3分钟内提高回避率5.','回避率可以在3分钟内提高5。','o'),(4,102,'黄昏之露可以恢复MP5000点。','恢复MP5000点。','o'),(4,103,'清晨之露可以恢复HP4000点。','恢复HP4000点。','x'),(4,104,'矿泉水在24小时排档、简、拜伦、哈娜、豪素夫、米舍凯那里有售。','明珠港的简不卖矿泉水。','x'),(4,105,'镇痛剂只有在地球防御本部的珮珀那里可以买到。','只有研制出镇痛剂的珮珀那里有售。','o'),(4,106,'NPC妖精珂丽尔在天空之城的武器商店里。','妖精珂丽尔在天空之城的杂货商店里。','x'),(4,107,'美味的香梭鱼和各种蔬菜一起制作而成的香梭鱼串，可以恢复MP500点。','香梭鱼(串)可以恢复MP250点。','x'),(4,108,'日本炒面(双倍)比日本炒面可以多提高魔力10。','日本炒面(双倍)比日本炒面可以多提高魔力5。','x'),(4,109,'比章鱼串能多提高攻击力5分钟的蛋炒面的价格要贵一倍。','章鱼串：2000金币，蛋炒面：4200金币','x'),(4,110,'日式拉面(烤肉)、日式拉面(猪排)、日式拉面(海鲜)都可以恢复HP。','都可以恢复HP。','o'),(4,111,'出售拉面、日式拉面的拉面料理师NPC的名字是元泰。','拉面料理师元泰出售各种拉面。','o'),(5,1,'电灯是德国人发明的','电灯这个给世界带来便捷的事物，是美国人爱迪生发明的','x'),(5,2,'明珠港的任务“简和野猪”完成之后，可以从简那里获得头盔防御卷轴。','不是头盔防御卷轴，而是武器卷轴。','x'),(5,3,'废弃都市组队任务在其他组队正在执行任务的时候无法入场。','其他组队如果正在执行任务，则无法入场。','o'),(5,4,'废弃都市的离家出走的少年阿勒斯的父亲是林中之城桑拿房的泰素夫。','阿勒斯的父亲是射手村的长老斯坦。','x'),(5,5,'完成约翰的粉红花篮任务之后，可以获得30个螺丝。','从约翰那里获得30个螺丝。','o'),(5,6,'地铁站服务员出售的工地B1、B2、B3入场费都是2000金币。','B1-500金币，B2-1200金币，B3-2000金币，价格各不相同。','x'),(5,7,'废弃都市组队任务的等级限制是Lev20~Lev30。','等级限制是21~30级。','x'),(5,8,'冒险岛里可以帮你制作氧气桶的古怪科学家叫卡兹','其实他叫秀兹，住在通天塔向水下世界的一个隐秘实验室里，有空去找找看吧。','x'),(5,9,'休咪的任务完成后，3次都能获得人气度报酬。','总共可以获得+3的人气度。','o'),(5,10,'在萨比特拉玛的年轻的药的任务中，可以获得星石或月石。','不是萨比特拉玛想要的东西的时候，得到月石。','o'),(5,11,'废弃都市组队任务总共由5个阶段组成。','必须要完成5个阶段的任务，也有不同阶段的奖励。','o'),(5,12,'在&lt;炼金术士简>任务中，会3次要求玩家帮助搜集材料。','只有3次全都搜集齐，才能完成任务。','o'),(5,13,'&lt;萨比特拉玛的减肥药>任务中，如果找错药草完成了的话，会获得EXP 500。','完成后获得500的经验值。','o'),(5,14,'黑斧木妖比火野猪厉害','这个用你们自己的身体去体会一下吧，火野猪比黑斧木妖更灵活，威力也更强','x'),(5,15,'五边形的内角和是720度','多边形内角和计算是180×（N-2），那么五边形内角和就是540度哦','x'),(5,16,'组队任务&lt;时空裂缝>一共由9个阶段组成，只有6人的组队才能执行。','等级限制是35~50。','o'),(5,17,'在射手村完成名为“玛亚和奇怪的药”之后，可以从玛亚那里获得“褐色斗笠”。','从玛亚那里可以获得“褐色斗笠”。','o'),(5,100,'&lt;简和野猪>任务完成后，可以随机获得100%、60%、10%武器攻击卷轴。','可以获得EXP 500、60%武器攻击卷轴。','x'),(5,101,'任务地图忍苦树林一共有5个阶段组成。','配制减肥药&lt;1.2阶段>，配制变年轻的药&lt;3.4.5阶段>','o'),(5,102,'休咪的任务按&lt;休咪丢失的钱团→钱袋→钱包>的顺序执行。','第2个任务是&lt;休咪丢失的钞票>。','x'),(5,103,'泰素夫任务中需要的特制烤鳗鱼的材料是猴子的香蕉、风独眼兽尾巴和猪的头。','特制烤鳗鱼里没有用到猴子的香蕉。','x'),(5,104,'任务地图沉睡森林由7个阶段组成。','沉睡森林一共由7个阶段组成。','o'),(5,105,'全部完成罗雯和诅咒娃娃任务所需要的诅咒娃娃的个数是2千3百个。','各需要100个、200个、400个、600个、1000个。','o'),(5,106,'足球运动的场上队员最多是每队11人','大家比较清楚吧，每队有10名球员和1名守门员上场，但如因为犯规罚下，会使场上队员人数下降','o'),(5,107,'乒乓球被成为中国的“国球”','目前为止确实如此，乒乓球因其在中国的普及率和国人的整体水平，被誉为中国的“国球”。','o'),(5,108,'&lt;萨比特拉玛的年轻的药>任务完成后，人气度会提高2。','可以获得人气度和经验值道具。','o'),(5,109,'&lt;查里中士和物物交换>任务所有的人都可以执行，和角色等级无关。','是新手也可以执行的任务。','o'),(5,110,'&lt;阿尔法部队联络网>任务中登场的NPC有珀斯上尉、巴伯中士、查里下士、伊吉上等兵。','登场的是珀斯上尉、巴伯下士、查里中士、伊吉上等兵。','x'),(5,111,'50级以上才能执行的&lt;寻找上古魔书>任务，是除新手之外所有职业都可以执行的任务。','除新手到55级以下的玩家外，所有的职业都可以执行。','x'),(5,112,'要提炼黑暗水晶，必须完成&lt;寻找上古魔书>任务的一部分。','必须完成任务中的阿尔卡斯特和黑暗水晶。','o'),(5,113,'皮奥的废品再利用任务中，会提供一把休闲椅作为报酬。','坐在休闲椅上，每10秒可以恢复HP50点。','o'),(5,114,'[伊卡路斯的滑翔翼 ]任务只有在[好无聊]任务结束后，32级以上的玩家才能执行。','伊卡路斯在废弃都市可以见到。','o'),(5,115,'妖精维英委托的[帮忙写作业]任务只有在[伊卡路斯的热气球]任务之后才能执行。','只有完成了[伊卡路斯的滑翔翼 ]任务的，10级以上的玩家可以执行。','x'),(5,116,'任务战利品之一的魔女草叶子只要捕捉魔女怪物[巫婆]就可以获得。','魔女草叶子只要攻击魔女草就可以获得。','x'),(5,117,'NPC邪摩斯委托的[为复活准备]任务完成之后，人气度会下降-2。','获得和鞋子有关的卷轴，人气度下降。','o'),(5,118,'[封印住神秘危险之力的仪式1]任务需要的道具是冰独眼兽给的阴森气息33个。','冰独眼兽给的道具是阴森气息。','x'),(5,119,'要执行[大海的遇难者]任务，必须要有SES求救信。','必须要有从怪物身上掉落的SOS求救信。','x'),(5,120,'[有关转职的教导]任务中，坤提出的问题一共有5个。','只要答对3个问题就能进入下一个阶段。','x'),(5,121,'足球世界杯、夏季奥运会、冬季奥运会都是每4年举行一次','对阿，这些重大体育赛事，都是4年举行一次，被全世界的朋友期待着，受到举世瞩目与关注','o'),(5,122,'太阳系有8大行星','目前太阳系8大行星，水星、金星、地球、火星、木星、土星、天王星、海王星，原本第九行星的冥王星，已不在此列。','o'),(5,123,'中国古代的“文房四宝”是纸、笔、印、砚','纸、笔、墨、砚才是中国古代的“文房四宝”','x'),(5,124,'中国古代的“四大发明”是造纸、火药、指南针、活字印刷','这四大发明是中国古代人民智慧的结晶，比起西方提早了几百年几千年呢。','o'),(5,125,'著名的侦探“福尔摩斯”是小说家柯南道尔塑造出来的','大家都知道福尔摩斯，是不是也清楚这个名侦探的创造者呢？他就是柯南道尔。','o'),(5,126,'《西游记》的作者是吴承恩，《水浒传》的作者是罗贯中','中国四大名著知多少？《西游记》作者是吴承恩，但《水浒传》作者可是施耐庵哦','x'),(5,127,'组队任务“月妙的年糕”只有达到100级以上才能参加。','月妙的年糕任务的限制等级是10级以上。','o'),(5,128,'“扎昆任务”的等级限制是70级。','扎昆任务的限制等级是50级。','x'),(5,129,'组队任务“月妙的年糕”只要和射手村公园的NPC达尔米对话就可以入场。','是NPC达尔利。','x'),(6,1,'2次转职时，搜集30个黑珠，可以得到道具“英雄证书”。','英雄证书是2次转职必需的道具。','o'),(6,2,'新手到了10级的时候，可以在战士、魔法师、弓箭手、飞侠中选择一个职业。','魔法师在8级时就可以转职。','x'),(6,3,'新手要想转职成为飞侠，要求运气至少在25以上。','敏捷(DEX)必须在25以上。','x'),(6,4,'新手第一次转职时，会获得1点技能点。','新手转职时，会获得1点技能点。','o'),(6,5,'想要4转的话，需要3转的角色的等级达到120级以上。','120级以上可以进行4次转职。','o'),(6,6,'魔法师可以使用瞬间移动技能——“快速移动”。','魔法师可以使用传送。','o'),(6,7,'飞侠的技能隐身术可以在隐自状态下攻击怪物。','在隐身状态下无法攻击怪物。','x'),(6,100,'学习并使用枪战士的“神圣之火”之后，可以增加最大HP、MP各60%。','全部掌握之后，可以各增加60%。','o'),(6,101,'弩弓手的技能中，“穿透箭”技能全部掌握后可以增加伤害180%。','全部掌握穿透箭之后，可以增加180%的伤害。','o'),(6,102,'飞侠在跳跃的状态下也可以使用标枪技能“双飞斩”。','飞侠在跳跃的状态下可以使用技能。','o'),(6,103,'新手要转职成为飞侠要去的地方是“废都酒吧”。','转职时要去的地方是废都酒吧。','x'),(6,104,'4转职业分为3个种类的职业是战士和法师。','只有战士分为3种职业。','x'),(6,105,'使用弓箭的弓箭手的转职顺序是[弓箭手 →猎人→ 射手→箭神]。','是按照[猎人→射手→神箭手]的顺序转职。','x'),(6,106,'使用短剑的飞侠的转职顺序是[飞侠→侠客→独行侠→隐士]。','是按照[飞侠→侠客→独行侠→侠盗]的顺序转职。','x'),(6,107,'4转后最终的职业加起来一共可以分为9种。','战士职业3种+魔法师职业2种+弓箭手职业2种+飞侠职业2种=9','o'),(6,108,'金钱炸弹是引爆地上的钱，对附近的敌人进行攻击的技能。','引爆地上的钱，给敌人造成伤害。','o'),(6,109,'召唤自己的分身，让怪物在一定时间内攻击自己分身的技能的名字是分身术。','分身术发动后，怪物会在一段时间内攻击分身。','o'),(6,110,'刺客的“强力投掷”技能可以消耗3个飞标，投掷出大飞标。','消费3个飞标，投掷出贯穿敌人的大飞标。','o'),(6,111,'使用独行侠的“落叶斩”技能，可以有一定的几率使怪物立刻死亡。','有一定几率使怪物昏迷。','x'),(6,112,'要学习龙骑士的“龙咆哮”技能，“龙之献祭”技能的等级需要在5级以上。','“龙之献祭”技能的等级必须在3级以上。','x'),(6,113,'要学习射手的“箭雨”技能，“烈火箭”必须达到3级以上。','\"贯穿箭\"技能必须达到5级以上。','x'),(6,114,'祭司的“圣光”技能可以攻击多个怪物。','最多可以攻击6个怪物。','o'),(6,115,'祭司的“巫毒”技能即使成功，怪物的基本能力值也不会发生变化。','基本能力值没有变化。','o'),(6,116,'要使用射手的“分身术” 技能，需要1个召回石。','不用召回石也可以使用。','x'),(6,117,'遭到冰雷巫师的“冰咆哮”技能攻击时，会暂时被冻结。','除冰属性外的怪物被冻结，最多只能同时6个怪物。','x'),(6,118,'新手技能“恢复”的再使用冷却时间是15分钟。','过了10分钟就可以使用。','x'),(7,1,'最初创建角色登录后，开始的地方是[彩虹岛]开始的。','冒险岛的故事最初开始的地方是[彩虹岛]。','o'),(7,2,'创建角色的时候需要掷骰子。这时STR、DEX、INT、LUK总共给予的点数合计24点。','合计25点。','x'),(7,3,'冒险岛中最先遇到的NPC是“丽娜”。','冒险岛中最先遇到的NPC是“希娜”。','x'),(7,4,'乘坐各个村庄之间的出租车的时候，对没有转职的新人的折扣价是1折。','新手只需要十分之一的金币就可以乘坐出租车。','o'),(7,5,'废弃都市可以购买药水和卷轴等的药店的名字是“废都药店”。','废弃都市可以购买药水的地方是“废都药店”。','o'),(7,6,'在村子里，及时快没有HP了，从高处掉下来也不会死亡。','即使在村子里，HP全部消耗完的话就会死亡。','x'),(7,7,'要想进入隐藏地图，必须是10级以上已经转职的角色。','谁都可以进入隐藏地图，没有限制。','x'),(7,8,'《三国演义》作者是罗贯中，《红楼梦》作者是曹雪芹','中国四大名著知多少？《三国演义》作者就是罗贯中，《红楼梦》是曹雪芹的作品','o'),(7,9,'在海边地图黄金海滩中，出售药水的大叔的名字是“拜伦”。','药水商人NPC的名字是“拜伦”。','o'),(7,100,'如果想邀请其他玩家和自己组队，只要直接右键点击目标角色进行邀请','如果自己要当队长邀请他人，首先需要建立自己的组队才能邀请他人','x'),(7,101,'折旧贩卖现金道具的情况下，会返还35%的冒险岛抵用券。','只返还30%。','x'),(7,102,'如果在2次转职等级的31级以上转职，无法获得奖励SP+1。','转职时都可以获得奖励SP。','x'),(7,103,'用冒险岛抵用券可以赠送现金道具。','用冒险岛抵用券无法赠送现金道具。','x'),(7,104,'水下世界的动物园里一共有4个怪物。','一共是蝙蝠怪、白雪人、白狼、漂漂猪和猪猪总共5个怪物。','x'),(7,105,'鲸鱼岛的NPC纳努科带着4条哈士奇犬。','带着褐色、黑色和灰色的哈士奇犬。','x'),(7,106,'椰子树林和鲸鱼岛地图中的鲸鱼的额头上贴着橡皮膏。','两个的额头上都贴着橡皮膏。','o'),(7,107,'太公的小船地图中的太公的钓鱼台上粘着一片树叶。','一共粘着3片树叶，但是钓鱼台上只有1片。','o'),(7,108,'玩具塔93层的玩具工人2手里拿着锤子。','其他的工人拿着其他工具。','o'),(7,109,'水下世界是位于玩具塔地下的水下地图。','水下世界是和通天塔相连接的地图。','x'),(7,110,'创建家族需要100万金币。','需要有150万金币才能创建家族。','x'),(7,111,'家族的人数最多可以提高至30名。','现在限制为30名。','o'),(7,112,'要把家族人数从10名提高到15名需要50万金币。','将家族人数从10名提高到15名需要50万金币。','x'),(7,113,'家族公告只有家族会长可以使用。','会长和副会长都可以使用家族公告功能。','x'),(7,114,'家族解散时需要20万金币的费用。','只有会长可以解散家族，需要20万金币的费用。','o'),(7,115,'制作家族徽章需要500万金币的费用。','家族徽章可以通过NPC蕾雅制作。','o'),(7,116,'负责家族创建和家族徽章制作的NPC是哈拉克。','负责制作家族徽章的 NPC是蕾雅。','x'),(7,117,'在村子里的“荣耀公馆”里，可以查看家族的排名。','在“荣耀之石”上可以查看家族的排名。','x'),(7,118,'任务提示中，最多可以登录5个任务。','可以登录5个任务，实时查看。','o'),(7,119,'在家族对抗战中，到奖励阶段为止，一共有6个阶段构成。','一共有7个阶段。','x'),(7,120,'氢氧化钙俗称“生石灰”','氢氧化钙俗称“熟石灰”，“生石灰”是氧化钙','x'),(7,121,'水下世界是直接与玩具塔地下相连接的水下地图。','水下世界是与通天塔相连的水下地图','x'),(7,122,'在水下世界中，每10秒钟HP都会减少。','如果没有氧气瓶或空气玲，每10秒钟HP都会减少。','o'),(7,123,'水下世界的大海的遇难者NPC的名字是“鲁宾逊克鲁索”。','就只是鲁宾逊。','x'),(7,124,'童话村的七南和七诚兄弟中，哥哥是七南。','七诚是哥哥，七南是弟弟。','x'),(7,125,'使用非法软件作弊玩游戏，会导致封号。','是的，为了你和他人的利益，请不要使用非法程序','o'),(7,126,'通过NPC“杜尔”可以向其他玩家发送特快邮件，费用是50,000。','NPC是杜宜，费用是5,000金币。','x'),(7,127,'射手村的世界旅游向导的名字是“娜娜”。','世界旅游向导的名字是“妮妮”。','x'),(7,128,'射手村迷宫入口的卫兵“鲁克”是右手握着枪。','鲁克是左手握着枪。','x'),(7,129,'勇士部落的NPC“伊安”的父亲是“布鲁斯”。','NPC伊安的父亲确实是布鲁斯。','o'),(7,130,'东部岩山II的NPC的名字是“战士转职教官”。','东部岩山ⅱ的NPC的名字是芳博士。','x'),(7,131,'皮亚奴斯出现的地图的名字是“皮亚奴斯的深海洞穴”。','是“皮亚奴斯的洞穴”。','x'),(7,132,'地球防御本部的鲁斯韦尔草原上的白外星人司令拄着拐杖。','不是鲁斯韦尔草原，而是库尔兰草原。','x'),(7,133,'干冰的化学成分是二氧化碳','干冰就是二氧化碳的固态形式，常用于制造舞台“烟雾效果”，同时可以辅助灭火','o'),(7,134,'NPC妙斯在水下世界动物园里。','NPC妙斯在水下世界动物园里。','o'),(7,135,'使用现金道具发送的特快专递可以很快发送到收件的对方。','是的，速度很快很方便，商城—其他—游戏，即可选购。','o'),(7,136,'日本古代神社的亚希子手里拿着吸尘器。','亚希子因为要打扫卫生，手里拿着扫帚。','x'),(7,137,'一天有86410秒','仔细想想，60秒/分，60分/小时乘起来结果起码要2个“0”结尾哦，一天有86400秒拉～','x'),(7,138,'上海城市广场上的驾驶员NPC的姓是林。','上海城市广场上的驾驶员姓洪。','x'),(7,139,'中国上海外滩的防具商人挽着袖子。','两只手都插在裤子口袋里。','x'),(7,140,'上海外滩的周的职业是巡警。','周是警察处长。','x'),(7,141,'中国上海外滩的吕现在正在打工。','不是在打工，是小摊的老板。','x'),(7,142,'在压力相同的条件下，受力面积越大，受到的压强也越大','同样的压力，作用的范围面积越小，产生的压强就越大。','x'),(7,143,'中国上海外滩的摄影师赵挂着2:8的相机。','摄影师赵挂着2:8的漂亮的相机。','o'),(7,144,'中国徐州平原Ⅲ的赵小姐穿着漂亮的连衣裙。','没有穿着连衣裙，而是穿着裤子。','x'),(7,145,'8月30日和9月1日出生的人都是处女座','对星座感兴趣的达人这下赚到了，这段时间出生的人都是处女座，处女座的小朋友有什么特点呢？','o'),(7,146,'2月18日和2月20日出生的人都是双鱼座','2月18日的是水瓶座啦，2月20日是双鱼座，更难的问题是，2月19日到底算什么座呢？','x'),(7,147,'Don\'t you like this quiz game?如果要回答“不，我很喜欢”，圈圈表示YES，叉叉表示NO，请大家两边站好','老外很直白，只要考虑真实感受就行了，如果喜欢，就说“Yes,I do.”','o'),(7,148,'地球防御本部郊外的白外星人哥雷，其实是个坏蛋','这个外星人假装可怜来欺骗我们，大家去揭穿他的丑恶行径吧，为了冒险岛的和平努力！','o'),(7,149,'玛加提亚村的人造人机器人的名字是人造人B。','玛加提亚村的人造人机器人的名字是人造人A。','x'),(7,150,'冒险岛的洗能力点卷轴一个要卖1000点','根本不用那么多点啦，100点就可以买到洗能力卷轴了，加错点随时可以洗哦，很方便达！','x'),(7,151,'如果不设置2重密码，就无法获得被盗处理。','被盗申报需要在设置2重密码后才能进行。','x'),(7,152,'现金商店里出售的装备道具可以提高能力值。','现金商店里的道具不能提高能力值。','x'),(7,153,'蒙特鸠的会长是卡森，卡帕莱特的会长是麦麦德。','卡森和卡帕莱特分别是蒙特鸠协会和卡帕莱特协会的会长。','o'),(7,154,'冒险岛聊天器最多可以邀请2名好友聊天。','冒险岛聊天器包括本人在内最多可以和3个人对话。','o'),(7,155,'被封印的道具限制1周最多解除1次。','可以通过客服中心1周解除1次。','o'),(7,156,'快递道具如果不及时领取，100日之后会消失。','快递道具的保管期限是30天。','x'),(7,157,'卡米拉害怕尤塔的猪猪农场上的铁甲猪。','卡米拉害怕的是漂漂猪。','x'),(7,158,'童话村的燕子因为道功从小喂它们吃蟠桃和神仙汤，所以变得很聪明。','由于吃了蟠桃和神仙汤，童话村的燕子变聪明了。','o'),(7,159,'玛加提亚的琦尼是妖精和人类的混血儿。','玛加提亚的琦尼是妖精和人类生的孩子。','o'),(7,160,'玛加提亚的杂货商人哲里也出售宠物的食物。','玛加提亚的杂货商人哲里那里也可以买到宠物的食物。','o'),(7,161,'废弃都市的所有悬赏公告牌都损坏了。','废弃都市没有完整的悬赏公告牌。','o'),(7,162,'童话村的乐夫穿着可以看到肚脐的衣服。','童话村的乐夫那里可以看到漂亮的肚脐。','o'),(7,163,'送货员杜宜鞋子的颜色是褐色的。','送货员杜宜穿着一双漂亮的褐色鞋子。','o'),(7,164,'勇士部落的仓库老板王先生是独眼龙。','在勇士部落可以见到独眼龙王先生。','o'),(7,165,'射手村的玛亚旁边有一个红色的邮箱。','玛亚的房子的入口处有一个可怕的红色邮箱。','o'),(7,166,'特别节日要进入特殊的万圣节古堡地图时，最好穿着特殊服饰','把自己打扮成小鬼小怪哦，不然很难进阴森的古堡，特定时间才买得到带有H标准的鬼怪服饰','o'),(8,1,'第一届世界杯是在意大利召开的。','第一届世界杯是在乌拉圭召开的，第二界是在意大利。','x'),(8,2,'世界杯每隔2年举行一次。','每隔4年举行一次。','x'),(8,3,'商城里一些服饰有标注“E”，是说明商品有折扣','不是这样哦，“E”标注的商品是组合在一起会产生特效！','x'),(8,4,'商城的“达人卡”是很划算的会员卡，可以在专区随便拿衣服','超合算的体验式会员卡啊，在有效期内，可以无限量在达人专区把衣服免费带走！','o'),(8,5,'足球是11个人的运动，而篮球是6个人的运动。','篮球是5个人玩的运动。','x'),(8,6,'奥林匹克五环旗中，代表亚洲的颜色是黄色。','奥运五环旗中的黄色象征亚洲。','o'),(8,100,'天空之城的艾利逊送给奈洛一条项链作礼物，奈洛是艾利逊暗恋的姑娘','奈洛其实是艾利逊可爱的小猫啦，不过艾利逊还是对奈洛非常非常关爱呀~','x'),(8,101,'在网球中，大满贯表示包揽US公开赛、法国公开赛、澳大利亚公开赛、温布尔登公开赛的冠军。','包揽4大主要赛事的冠军被称为大满贯。','o'),(8,102,'高尔夫中，比标准杆少1杆被称为小鸟球，少2杆被称为老鹰球，少3杆被称为双柏忌。','少3杆被称为双老鹰。','x'),(8,103,'制作送给“奈洛的项链”的材料需要去魔法密林用钻石和妖精艾温兑换','其实只要去商城用心寻找一下只需1个金币就可购买铃铛和红丝带，就可制作奈洛的项链啦！','x'),(8,104,'宠物“进化龙”不仅技能丰富，还可以进化成多种不同形态，其中黑龙很稀有','这些说得全是真的哦，拥有黑龙的玩家都是超幸运的呀！有没有试过“变身”啊？','o'),(8,105,'新一代进化宠“罗伯”除了有稀有形态进化，还有超稀有形态的“变异”呢','太厉害了，除了有“金色形态”的进化，罗伯还有可能进化成超稀有形态的黑猩猩“金刚”啊！！','o'),(8,106,'在宠物商人和商城内购买的宠物食品都是所有宠物都可以吃的','宠物商人那买的宠物食品是通用的，但商城内食品是针对不同宠物让宠物成长更迅速！','x'),(8,107,'在足球中发任意球的时候，对方运动员距离踢球的运动员的距离必须在9.15米以上。','如果进入9.15m内会受到警告。','o'),(8,108,'将游泳设为正式比赛项目的奥运会是1896年的第一届奥运会。','是从1900年的第二届奥运会时被设为正式比赛项目的。','x'),(8,109,'商城大礼包，不仅比购买多个单品便宜，而且还可以购买到单品中买不到的商品','啊啊，大礼包真的是很棒啊，不仅价格有优惠，还有特别贩售版，平时想买也买不到哦','o');
